import React from 'react';

const CartPage = ({ cart }) => {
    return (
        <div className="cart-page">
            <h2>Your Cart</h2>
            {cart.length === 0 ? (
                <p>Your cart is empty</p>
            ) : (
                <ul>
                    {cart.map((item) => (
                        <li key={item.id}>
                            {item.name} - {item.quantity} x {item.price} $
                        </li>
                    ))}
                </ul>
            )}
        </div>
    );
};

export default CartPage;
